import { React, useState} from "react";
import Button from "../components/Button";
import Textbox from "../components/Textbox";

const Register=()=>{
    const [userData, updateUserData]=useState([
        {
            user:{
                fullName:'',
                dob:'',
                email:'',
                phone:'',
                password:'',
                cpassword:''
            }
        }
    ])
    const inputDataChange=(event)=>{
        updateUserData([
            {
                user:{
                    fullName:event.target.value,
                    dob:event.target.value,
                    email:event.target.value,
                    phone:event.target.value,
                    password:event.target.value,
                    cpassword:event.target.value
                }
            }
        ])
        console.log(event.target.value)
    }
    const signupStudent=()=>{
        console.log("signup button clicked. Navigating to Verify.js");
    }
    return(
        <div className="container-box cg-background-clr">
            <div className="topDiv">
                <h3>Hello! <br/> Sign up to get started.</h3>
            </div>
            <div className="bottomDiv">
                <form>
                    <Textbox label="Full name" name={userData[0].user.fullName} inputDataChange={inputDataChange}/>
                    <Textbox label="Email" name={userData[0].user.email} inputDataChange={inputDataChange}/>
                    <Textbox label="Phone" name={userData[0].user.phone} inputDataChange={inputDataChange}/>
                    <Textbox label="Date of Birth" name={userData[0].user.dob} inputDataChange={inputDataChange}/>
                    <Textbox label="Password" name={userData[0].user.password} inputDataChange={inputDataChange}/>
                    <Textbox label="Confirm password" name={userData[0].user.cpassword} inputDataChange={inputDataChange}/>
                    <Button name="signupBtn" label="Sign Up" onClick={signupStudent} />
                </form>
            </div>
        </div>
    )

}

export default Register;
